const ClientForm = () => {

    return (

        <form>
            <label htmlFor={"classTime"}> </label>

            <label htmlFor={"classDate"}> </label>

            <label htmlFor={"classDuration"}> </label>

            <label htmlFor={"classType"}> </label>

            <label htmlFor={"intensityLvl"}> </label>
        </form>
    )

}
export default  ClientForm
